import sql from 'mssql'

const dbSettings = {
  user: 'root', 
  password:'*eVitra25#!',
  server: 'EVITRA2K16',
  database: 'Evitra25',
  options: {
    port: 49704,
    encrypt: true,
    trustServerCertificate: true,
   
  }
};

export async function getConnection(){
  try{
  const pool = await sql.connect(dbSettings);
  return pool;
}catch(error){
  console.log(error);
}

}

